import React, {useContext, useState} from 'react';
import {Link} from 'react-router-dom';
import { GridList } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

import { 
  Container,
  HeaderDiv,
  Logo,
  UserNameLink,
  BodyDiv,
  MenuDiv,
  BtnMenuHome,
  BtnMenuAgenda,
  // BtnMenuRedeCredenciada,
  BtnMenuConsulta,
  BtnMenuSair,
  List,
  ListItens

} from './styles';
import AuthContext from '../../../contexts/Auth';


import logo from '../../../assets/Image/Logo_Dashboard.png'

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    backgroundColor: theme.palette.background.paper,
  },
  gridList: {
    width: 750,
    height: 450,
  },
}));

export default function Rede_Credenciada() {
  const classes = useStyles();
  const { user } = useContext(AuthContext);
  const [dados, setDados] = useState([
    {
      id: 1,
      medico: 'samuel rodrigues de melo',
      local: 'rua jonas leite',
      telefone: '15-98134-4323', 
    },
    {
      id: 2,
      medico: 'samuel rodrigues de melo',
      local: 'rua jonas leite',
      telefone: '15-98134-4323', 
    },
    {
      id: 3,
      medico: 'samuel rodrigues de melo',
      local: 'rua jonas leite',
      telefone: '15-98134-4323', 
    },
    {
      id: 4,
      medico: 'samuel rodrigues de melo',
      local: 'rua jonas leite',
      telefone: '15-98134-4323', 
    },
    {
      id: 5,
      medico: 'samuel rodrigues de melo',
      local: 'rua jonas leite',
      telefone: '15-98134-4323', 
    },
    {
      id: 6,
      medico: 'samuel rodrigues de melo',
      local: 'rua jonas leite',
      telefone: '15-98134-4323', 
    },
    {
      id: 7,
      medico: 'samuel rodrigues de melo',
      local: 'rua jonas leite',
      telefone: '15-98134-4323', 
    },
    {
      id: 8,
      medico: 'samuel rodrigues de melo',
      local: 'rua jonas leite',
      telefone: '15-98134-4323', 
    },
    {
      id: 9,
      medico: 'samuel rodrigues de melo',
      local: 'rua jonas leite',
      telefone: '15-98134-4323', 
    },
    {
      id: 10,
      medico: 'samuel rodrigues de melo',
      local: 'rua jonas leite',
      telefone: '15-98134-4323', 
    },
    {
      id: 11,
      medico: 'samuel rodrigues de melo',
      local: 'rua jonas leite',
      telefone: '15-98134-4323', 
    },
    {
      id: 10,
      medico: 'samuel rodrigues de melo',
      local: 'rua jonas leite',
      telefone: '15-98134-4323', 
    },


  ])
  // const classes = useStyles();


  return(
    <Container>
      <HeaderDiv>
        <Link to={"/dashboard_Paciente"} >
          <Logo src={logo} />
        </Link>
        <UserNameLink href={"/"}>{user.nome}</UserNameLink>
      </HeaderDiv>

      <BodyDiv>
        <MenuDiv>
            <Link to={"/dashboard_Paciente"}>Home</Link>
            <br/>
            <Link to={"/"}>Agendas</Link>
            <br/>
            <Link to={"/rede_Credenciada"}>Rede Credenciada</Link>
            <br/>
            <Link to={"/"}>Agendar Consulta</Link>
            <br/>
            <Link to={"/signin"}>Sair</Link>
        </MenuDiv>
        <List>
        <GridList className={classes.gridList} >
        {
            dados.map(function(data){
              return(
                <ul key={data.id} >
                  <li>medico {data.id}</li>
                  <li>{data.medico}</li>
                  <li>{data.local}</li>
                  <li>{data.telefone}</li>
                </ul>
              )
            })
          }
        </GridList>
        </List>

        {/* <List>

        </List> */}



      </BodyDiv>

    </Container>
  );
}
